const JavaScriptObfuscator = require('javascript-obfuscator')

const everywhat = process.env.afk.everywhat
const gaincoins = process.env.afk.gaincoins
const waitforwebsocketreq = 10000 // 10 seconds

const currentlyonpage = {}
const currentlyonpage_ip = {}

module.exports.load = async function (app, ifValidAPI, ejs) {
  app.ws('/earn/afk', async (ws, req) => {
    let onpage = false

    if (!req.session.arcsessiontoken) ws.close()

    if (typeof req.session.arcsessiontoken !== 'object') {
      delete req.session.arcsessiontoken
      return ws.close()
    }

    const arcsessiontoken = Object.assign(req.session.arcsessiontoken, {})

    if (!arcsessiontoken) {
      delete req.session.arcsessiontoken
      return ws.close()
    }

    const token = req.headers['sec-websocket-protocol']

    if (!token) return ws.close()
    if (typeof token !== 'string') return ws.close()

    if (token !== arcsessiontoken.token) {
      delete req.session.arcsessiontoken
      return ws.close()
    }

    if (Date.now() > arcsessiontoken.created + waitforwebsocketreq) {
      delete req.session.arcsessiontoken
      return ws.close()
    }

    const ip = req.headers['x-forwarded-for'] || req.connection.remoteAddress

    if (currentlyonpage[req.session.data.userinfo.id]) { // currentlyonpage_ip[ip]
      delete req.session.arcsessiontoken
      if (ws.readyState === 1) await ws.send('{"error": "Already on page."}')
      if (ws.readyState === 1) await ws.close()
      return
    }

    delete req.session.arcsessiontoken

    onpage = true

    currentlyonpage[req.session.data.userinfo.id] = true
    currentlyonpage_ip[ip] = true

    const coinloop = setInterval(
      async () => {
        await process.db.addCoinsByDiscordID(req.session.data.userinfo.id, gaincoins)
      }, everywhat * 1000
    )

    ws.onclose = async () => {
      if (!onpage) return

      clearInterval(coinloop)
      delete currentlyonpage[req.session.data.userinfo.id]
      delete currentlyonpage_ip[ip]
    }
  })
}

